import React from 'react';
import { StyleSheet, View } from 'react-native';
import { Text } from 'react-native-elements';
import { MyFavPetFlatList } from '../components/MyFavPetFlatList';
import { MyFavStackProps } from '../types';


export default function MyFavScreen({ navigation }: MyFavStackProps<'MyFav'>) {

  return (<>
    <Text style={styles.header}>My Favourite</Text>
    <View style={styles.container}>

      <MyFavPetFlatList navigation={navigation} />
    </View>
  </>
  );
}

const styles = StyleSheet.create({
  header: {
    fontSize: 30,
    fontWeight: 'bold',
    color: '#298e96',
    backgroundColor: 'white',
    padding: 20,
    paddingTop: 40,
    paddingBottom: 0,
  },
  container: {
    flex: 1,
    padding: 20,
    paddingBottom: 0,
    backgroundColor: 'white',
    justifyContent: 'flex-start'

  },
});
